Ваш телефон выключился из-за перегрева. Сейчас он работает нормально.

Возможные причины перегрева телефона:
 • использование ресурсоемких игр и приложений, связанных с видео или навигацией);
 • скачивание или загрузка больших файлов;
 • высокая температура окружающей среды.

