column4:
Если вы не пользовались приложением несколько месяцев:

• разрешения будут отозваны для защиты ваших данных;
• уведомления будут отключены для экономии заряда батареи;
• временные файлы будут удалены, чтобы освободить место.

Чтобы заново предоставить разрешения и включить уведомления, откройте приложение.
